import React from 'react'
import { Text, TouchableOpacity,Dimensions } from 'react-native';
const Date=(props) =>{
    const {width, height} = Dimensions.get('window')
    return (
        
         <TouchableOpacity style={{position: 'absolute'}}>
         <Text style={{fontSize: 16,borderRadius:500,backgroundColor:'white',width:40,paddingLeft:10,marginLeft:11,color:'#4A54A4'}}>{props.date2}</Text>
         </TouchableOpacity>
    );
};
export default Date;
